script: |
  super -f text -I q8269.spq | sort > q8269.out

inputs:
  - name: q8269.spq
    data: |
      SELECT - - col0 * + col2 AS col2, - 94 FROM tab1 (FORMAT parquet) WHERE - col2 + + 11 * - col1 * + 11 < + + 44;
  - name: tab1

outputs:
  - name: q8269.out
    data: |
      4896	-94
      5015	-94
      6188	-94
